import { Outlet, Route, Routes } from "react-router";
import Navbar from "./components/Navbar";
import Homepage from "./pages/Homepage";

function App() {
  return (

    <Routes>
      <Route path="/" element={<Layout />} />
      <Route index element={<Homepage />} />
    </Routes>
  )
}
export default App;

function Layout() {
  return (
    <div>
      <Navbar />

      <Outlet />

    </div>
  )
}
